import React, { useState, useEffect } from 'react';
import ReactApexChart from 'react-apexcharts';
import axios from 'axios';

const AbnormalDetectionChart: React.FC = () => {
  const [state, setState] = useState({
    series: [],
    options: {
      chart: {
          height: 350,
          type: 'bubble' as const,
      },
      dataLabels: {
          enabled: false
      },
      fill: {
          opacity: 0.8
      },
      title: {
          text: ''
      },
      xaxis: {
          tickAmount: 12,
          type: 'category' as const,
      },
      yaxis: {
          max: 100
      }
    },
  });

  useEffect(() => {
    const fetchData = async () => {
      const result = await axios.get('data.json'); // adjust this to the actual path of your JSON file
      setState({ ...state, series: result.data.series });
    };

    fetchData();
  }, []);

  return <ReactApexChart options={state.options} series={state.series} type="bubble" height={350} />;
};

export default AbnormalDetectionChart;
